{"de": "####Naturschutz und Biodiversität


-	Die Förderung und der Erhalt der Biodiversität gewinnt zunehmend auch in den sich ausbreitenden Siedlungsgebieten an Bedeutung. Durch eine naturnahe Gestaltung der Umgebung kann wertvoller Lebensraum für Tiere und Pflanzen geschaffen werden. Davon profitieren erwiesenermassen auch wiederum die Menschen. 
-	Garten und Gebäude bieten eine Vielzahl an Möglichkeiten, neuen Lebensraum für Tiere und Pflanzen zu schaffen. Während Rasenflächen, Thuja-Hecken oder Steinwüsten niemandem etwas bringen, sorgen farbenprächtige Blumenwiesen, artenreiche Naturhecken und wilde Ecken mit Ast- und Steinhaufen für buntes Leben in ihrem Garten.", "fr": "", "it": ""}

